import HocMain from './HocMain'

class HocB extends Component {
    
    render() {
        return (
            <>
                <div>HocB</div>
                <button className='btn btn-primary' onMouseLeave={()=>this.setState({value:this.state.value+1})}>HocA</button>
                {this.state.value}
            </>
        )
    }
}

export default HocMain(HocB)
